export const Header = () => {
  return (
    <header className="container">
      <div className="logo">
        <Text color={"#2C5282"} m={0}>
          Абсолют
        </Text>
      </div>
      <Flex className="menu" gap={3} justifyContent={"center"}>
        <Link> Home</Link>
        <Link> About</Link>
        <Link> Rooms</Link>
        <Button
          bg={"#BEE3F8"}
          border={0}
          p={10}
          borderRadius={10}
          color={"#2C5282"}
          fontSize={"18px"}
          fontWeight={"700"}
        >
          Contact
        </Button>
      </Flex>
    </header>
  );
};
